import React, { useState, useEffect } from 'react';
import { api } from '../utils/api';

const AdminUsers = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const response = await api.get('/users/admin');
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching users:', error);
      setUsers([]);
    } finally {
      setLoading(false);
    }
  };

  const toggleUserStatus = async (userId, isActive) => {
    try {
      await api.put(`/users/${userId}/status`, { isActive: !isActive });
      fetchUsers();
    } catch (error) {
      console.error('Error updating user status:', error);
    }
  };

  if (loading) {
    return <div style={styles.loading}>Loading users...</div>;
  }

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Manage Users</h1>

      <div style={styles.tableContainer}>
        <table style={styles.table}>
          <thead>
            <tr style={styles.headerRow}>
              <th style={styles.th}>Name</th>
              <th style={styles.th}>Email</th>
              <th style={styles.th}>Role</th>
              <th style={styles.th}>Status</th>
              <th style={styles.th}>Joined</th>
              <th style={styles.th}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {users.length === 0 ? (
              <tr>
                <td colSpan="6" style={styles.noData}>No users found</td>
              </tr>
            ) : (
              users.map(user => (
                <tr key={user._id} style={styles.row}>
                  <td style={styles.td}>{user.name}</td>
                  <td style={styles.td}>{user.email}</td>
                  <td style={styles.td}>
                    <span style={{...styles.role, backgroundColor: user.isAdmin ? '#ff6b35' : '#28a745'}}>
                      {user.isAdmin ? 'Admin' : 'User'}
                    </span>
                  </td>
                  <td style={styles.td}>
                    <span style={{...styles.status, backgroundColor: user.isActive ? '#28a745' : '#dc3545'}}>
                      {user.isActive ? 'Active' : 'Inactive'}
                    </span>
                  </td>
                  <td style={styles.td}>
                    {new Date(user.createdAt).toLocaleDateString()}
                  </td>
                  <td style={styles.td}>
                    <button 
                      onClick={() => toggleUserStatus(user._id, user.isActive)}
                      style={{...styles.actionBtn, backgroundColor: user.isActive ? '#dc3545' : '#28a745'}}
                    >
                      {user.isActive ? 'Deactivate' : 'Activate'}
                    </button>
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '2rem',
    backgroundColor: '#fef7f0',
    minHeight: '90vh'
  },
  title: {
    fontSize: '2rem',
    fontWeight: '700',
    color: '#333',
    marginBottom: '2rem'
  },
  tableContainer: {
    backgroundColor: 'white',
    borderRadius: '15px',
    boxShadow: '0 4px 15px rgba(0,0,0,0.1)',
    overflow: 'hidden'
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse'
  },
  headerRow: {
    backgroundColor: '#f8f9fa'
  },
  th: {
    padding: '1rem',
    textAlign: 'left',
    fontWeight: '600',
    color: '#333',
    borderBottom: '2px solid #e9ecef'
  },
  row: {
    borderBottom: '1px solid #e9ecef'
  },
  td: {
    padding: '1rem',
    color: '#666'
  },
  role: {
    padding: '0.25rem 0.75rem',
    borderRadius: '15px',
    color: 'white',
    fontSize: '0.8rem',
    fontWeight: '600'
  },
  status: {
    padding: '0.25rem 0.75rem',
    borderRadius: '15px',
    color: 'white',
    fontSize: '0.8rem',
    fontWeight: '600'
  },
  actionBtn: {
    padding: '0.5rem 1rem',
    border: 'none',
    borderRadius: '20px',
    color: 'white',
    fontSize: '0.8rem',
    fontWeight: '600',
    cursor: 'pointer'
  },
  loading: {
    textAlign: 'center',
    padding: '4rem',
    fontSize: '1.2rem',
    color: '#666'
  },
  noData: {
    textAlign: 'center',
    padding: '2rem',
    color: '#666'
  }
};

export default AdminUsers;
